import React from 'react';
//import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import { Card, CardColumns } from 'react-bootstrap'

function cardStuff() {
   return (
    <div>

    <CardColumns>
    <Card className='mb-3' style={{ color: "#000" }}>
    
       <Card.Body>
        <p>hi</p>
       <Card.Title>About</Card.Title>          
        </Card.Body>
    </Card>
 
    <Card className='mb-3' style={{ color: "#000" }}>
    
    <Card.Body>
      hi
       <Card.Title>
             About
       </Card.Title>          
    </Card.Body>
    </Card>
 
   </CardColumns>
    </div>
    );
}
export default cardStuff;
